import { Box, Card, CardHeader, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material'
import React from 'react'
import { useSelector } from 'react-redux'

export default function OrderTable({ name, isDashboard }) {
  const { restaurantOrder } = useSelector(store => store);
  return (
    <Box>
      <Card>
        <CardHeader
          title={name}
          sx={{
            pt: 2, 
            alignItems: "center", 
            "& .MuiCardHeader-action": { mt: 0.6 },
          }}
        />
        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Id</TableCell>
                <TableCell>Image</TableCell>
                <TableCell>Price</TableCell>
                <TableCell>Name</TableCell>

                {!isDashboard && <TableCell>Ingredients</TableCell>}
                {!isDashboard && <TableCell>Status</TableCell>}
                {
                  !isDashboard && (
                    <TableCell sx={{ textAlign: "center"}}>Update</TableCell>
                  )
                }
              </TableRow>
            </TableHead>
            <TableBody>
              {
                restaurantOrder.orders
                  ?.slice(0, isDashboard ? 7 : restaurantOrder.orders.length)
                  .map((item, index) => (
                    <TableRow>
                      <TableCell>{ item.id}</TableCell>
                    </TableRow>
                  ))
              }
            </TableBody>
          </Table>
        </TableContainer>
      </Card>
    </Box>
  )
}
